var glbl = (function() {
    var canvas;
    var padding;
    var width, height;
    var xOffset, yOffset;
    var xCellCount, yCellCount;
    var gridCount;
    var url = 'http://localhost:5000';
    var data;
    var context;
    var cellSize = 40;
    var values = [];
    var colors = [[0, 51, 153], [0, 102, 0], [153, 0, 0], [153, 102, 0], [0, 153, 255], [102, 204, 51], [255, 153, 51], [102, 102, 204], [255, 51, 0], [255, 255, 0]];
    return {
        canvas: canvas,
        padding: padding,
        width: width,
        height: height,
        xOffset: xOffset,
        yOffset: yOffset,
        xCellCount: xCellCount,
        yCellCount: yCellCount,
        gridCount: gridCount,
        url: url,
        context: context,
        cellSize: cellSize,
        values: values,
        colors: colors,
        data: data,
    };
})();

var $class = function(definition) {
    var constructor = definition.constructor; 
    var parent = definition.Extends;
    if (parent) {
        var F = function() { };
        constructor._superClass = F.prototype = parent.prototype;
        constructor.prototype = new F();
    }
    for (var key in definition) {
        constructor.prototype[key] = definition[key];
    }
    constructor.prototype.constructor = constructor;
    return constructor;
};

